<?php

class DMPRO_DiviModulesPro extends DiviExtension {

	/**
	 * The gettext domain for the extension's translations.
	 *
	 * @since 1.0.0
	 *
	 * @var string
	 */
	public $gettext_domain = 'dmpro-divi-modules-pro';

	/**
	 * The extension's WP Plugin name.
	 *
	 * @since 1.0.0
	 *
	 * @var string
	 */
	public $name = 'divi-modules-pro';

	/**
	 * The extension's version
	 *
	 * @since 1.0.0
	 *
	 * @var string
	 */
	public $version = '1.0.1';

	/**
	 * DMPRO_DiviModulesPro constructor.
	 *
	 * @param string $name
	 * @param array  $args
	 */
	public function __construct( $name = 'divi-modules-pro', $args = array() ) {
		$this->plugin_dir     = plugin_dir_path( __FILE__ );
		$this->plugin_dir_url = plugin_dir_url( $this->plugin_dir );
		$this->_builder_js_data = array(
            'l10n' => [
                'no_date_configured' => esc_html__( 'No Date Configured', 'dmpro-divi-modules-pro' ),
                'forwarding' => esc_html__( 'The countdown has finished. On the frontend, you would now be forwarded to', 'dmpro-divi-modules-pro' ),
            ],
            'defaults' => [
                'image' => "data:image/jpeg;base64,",
                'title' => esc_html__('Lorem Ipsum', 'dmpro-divi-modules-pro'),
                'content' => esc_html__('Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Aenean commodo ligula eget dolor.', 'dmpro-divi-modules-pro'),
            ],
		    );
		parent::__construct( $name, $args );
		
	}
}

new DMPRO_DiviModulesPro;
